     4→<head>
     5→    <meta charset='UTF-8'>
     6→    <meta name='viewport' content='width=device-width, initial-scale=1.0'>
     7→    <title>{{ title }}</title>
     8→    <style>
     9→        body {
    10→            font-family: 'SF Mono', 'Monaco', 'Inconsolata', 'Fira Code', 'Droid Sans Mono', 'Source Code Pro', 'Ubuntu Mono', 'Cascadia Code', 'Menlo', 'Consolas', monospace;
