    14→            padding: 20px;
    15→            background: linear-gradient(90deg, #f3d6d2, #f1dcce, #f0e4ca, #eeecc7, #e3ecc3, #d5eac0, #c6e8bd, #b9e6bc, #b6e3c5, #b3e1cf);
    16→            color: #333;
    17→        }
    18→
    19→        h1 {
    20→            text-align: center;
    21→            color: #2c3e50;
    22→            margin-bottom: 30px;
    23→            font-size: 2em;
    24→        }
    25→
    26→        .project-list {
    27→            display: grid;
    28→            gap: 15px;
    29→        }
    30→
    31→        .project-card {
    32→            background-color: #ffffff66;
    33→            border-radius: 8px;
    34→            padding: 20px;
    35→            box-shadow: -7px -7px 10px #eeeeee44, 7px 7px 10px #00000011;
    36→            border-left: #ffffff66 1px solid;
    37→            border-top: #ffffff66 1px solid;
    38→            border-bottom: #00000017 1px solid;
    39→            border-right: #00000017 1px solid;
    40→        }
    41→
    42→        .project-card:hover {
    43→            box-shadow: -10px -10px 15px #eeeeee66, 10px 10px 15px #00000022;
    44→            transform: translateY(-1px);
    45→            transition: all 0.2s ease;
    46→        }
    47→
    48→        .project-name {
    49→            font-size: 1.2em;
    50→            font-weight: 600;
    51→            margin-bottom: 10px;
    52→            word-break: break-all;
    53→        }
    54→
    55→        .project-name a {
    56→            text-decoration: none;
    57→            color: #2196f3;
    58→        }
    59→
    60→        .project-name a:hover {
    61→            text-decoration: underline;
    62→        }
    63→
    64→        .project-stats {
    65→            color: #666;
    66→            font-size: 0.9em;
    67→            display: flex;
    68→            gap: 20px;
    69→            flex-wrap: wrap;
    70→        }
    71→
    72→        .stat {
    73→            display: flex;
    74→            align-items: center;
    75→            gap: 5px;
    76→        }
    77→
    78→        .summary {
    79→            text-align: center;
    80→            margin-bottom: 30px;
    81→            padding: 15px;
    82→            background-color: #ffffff66;
    83→            border-radius: 8px;
    84→            box-shadow: -7px -7px 10px #eeeeee44, 7px 7px 10px #00000011;
    85→            border-left: #ffffff66 1px solid;
    86→            border-top: #ffffff66 1px solid;
    87→            border-bottom: #00000017 1px solid;
    88→            border-right: #00000017 1px solid;
    89→        }
    90→
    91→        .summary-stats {
    92→            display: flex;
    93→            flex-direction: column;
    94→            align-items: center;
    95→            gap: 15px;
    96→        }
    97→
    98→        .summary-stat {
    99→            text-align: center;
   100→        }
   101→
   102→        .summary-stat .number {
   103→            font-size: 1.5em;
   104→            font-weight: 600;
   105→            color: #2196f3;
   106→        }
   107→
   108→        .summary-stat .label {
   109→            color: #666;
   110→            font-size: 0.9em;
   111→        }
   112→    </style>
   113→</head>
   114→
   115→<body>
   116→    <h1>{{ title }}</h1>
   117→
   118→    <div class='summary'>
   119→        <div class='summary-stats'>
   120→            <div style="display: flex; gap: 3em;">
   121→                <div class='summary-stat'>
   122→                    <div class='number'>{{ summary.total_projects }}</div>
   123→                    <div class='label'>Projects</div>
   124→                </div>
   125→                <div class='summary-stat'>
   126→                    <div class='number'>{{ summary.total_jsonl }}</div>
   127→                    <div class='label'>Transcript Files</div>
   128→                </div>
   129→                <div class='summary-stat'>
   130→                    <div class='number'>{{ summary.total_messages }}</div>
   131→                    <div class='label'>Messages</div>
   132→                </div>
   133→            </div>
   134→            {% if summary.token_summary %}
   135→            <div class='summary-stat'>
   136→                <div class='number'>🪙</div>
   137→                <div class='label'>{{ summary.token_summary }}</div>
   138→            </div>
   139→            {% endif %}
   140→            {% if summary.formatted_time_range %}
   141→            <div class='summary-stat'>
   142→                <div class='number'>🕐</div>
   143→                <div class='label'>{{ summary.formatted_time_range }}</div>
   144→            </div>
   145→            {% endif %}
   146→        </div>
   147→    </div>
   148→
   149→    <div class='project-list'>
   150→        {% for project in projects %}
   151→        <div class='project-card'>
   152→            <div class='project-name'>
   153→                <a href='{{ project.html_file }}'>{{ project.display_name }}</a>
   154→            </div>
   155→            <div class='project-stats'>
   156→                <div class='stat'>📁 {{ project.jsonl_count }} transcript files</div>
   157→                <div class='stat'>💬 {{ project.message_count }} messages</div>
   158→                {% if project.formatted_time_range %}
   159→                <div class='stat'>🕒 {{ project.formatted_time_range }}</div>
   160→                {% else %}
   161→                <div class='stat'>🕒 {{ project.formatted_date }}</div>
   162→                {% endif %}
   163→                {% if project.token_summary %}
   164→                <div class='stat'>🪙 {{ project.token_summary }}</div>
   165→                {% endif %}
   166→            </div>
   167→        </div>
   168→        {% endfor %}
   169→    </div>
   170→</body>
   171→
   172→</html>

