    box-shadow: 2px 2px 5px rgba(0, 0, 0, 0.2);
    transition: background-color 0.3s, transform 0.2s;
    z-index: 1000;
    text-decoration: none;
}

.floating-btn:hover {
    background-color: #e8f4fdcc;
    transform: translateY(-2px);
}

.floating-btn:visited {
    color: #666;
}

/* Message and content styles */
.message {
    margin-bottom: 1em;
    padding: 1em;
    border-radius: 8px;
    border-left: #ffffff66 1px solid;
    background-color: #e3f2fd55;
    box-shadow: -7px -7px 10px #eeeeee44, 7px 7px 10px #00000011;
    border-top: #ffffff66 1px solid;
    border-bottom: #00000017 1px solid;
    border-right: #00000017 1px solid;
}

.session-divider {
    margin: 70px 0;
    border-top: 2px solid #fff;
}

/* Message type styling */
.user {
    border-left-color: #2196f3;
}

.assistant {
    border-left-color: #9c27b0;
}

.system {
    border-left-color: #ff9800;
}

.tool_use {
    border-left-color: #e91e63;
}

.tool_result {
    border-left-color: #4caf50;
}

.thinking {
    border-left-color: #9e9e9e;
}

.image {
    border-left-color: #ff5722;
}

/* Session header styling */
.session-header {
    background-color: #e8f4fd66;
    border-radius: 8px;
    padding: 16px;
    margin: 30px 0 20px 0;
    box-shadow: -7px -7px 10px #eeeeee44, 7px 7px 10px #00000011;
    border-left: #ffffff66 1px solid;
    border-top: #ffffff66 1px solid;
    border-bottom: #00000017 1px solid;
    border-right: #00000017 1px solid;
}

.session-header .header {
    margin-bottom: 8px;
    font-size: 1.2em;
}

/* Content styling */
.content {
    word-wrap: break-word;
}

.content > pre {
    background-color: transparent;
    padding: 0;
    border-radius: 0;
}

.header:has(+ .content > details) {
    margin-left: 1em;
}

/* Tool content styling */
.tool-content {
    background-color: #f8f9fa66;
    border-radius: 4px;
    padding: 8px;
    margin: 8px 0;
    overflow-x: auto;
    box-shadow: -4px -4px 10px #eeeeee33, 4px 4px 10px #00000007;
    border-left: #ffffff66 1px solid;
    border-top: #ffffff66 1px solid;
    border-bottom: #00000017 1px solid;
    border-right: #00000017 1px solid;
}

.tool-result {
    background-color: #e8f5e866;
    border-left: #4caf5088 1px solid;
}

.tool-use {
    background-color: #e3f2fd66;
    border-left: #2196f388 1px solid;
}

.thinking-content {
    background-color: #f0f0f066;
    border-left: #66666688 1px solid;
}

.thinking-text {
    font-style: italic;
    white-space: pre-wrap;
    word-wrap: break-word;
    color: #555;
}

.tool-input {
    background-color: #fff3cd66;
    border-radius: 4px;
    padding: 6px;
    margin: 4px 0;
    font-size: 0.9em;
    box-shadow: -7px -7px 10px #eeeeee44, 7px 7px 10px #00000011;
    border-left: #ffffff66 1px solid;
    border-top: #ffffff66 1px solid;
    border-bottom: #00000017 1px solid;
    border-right: #00000017 1px solid;
}

/* Session summary styling */
.session-summary {
    background-color: #ffffff66;
    border-left: #4caf5088 4px solid;
    padding: 12px;
    margin: 8px 0;
    border-radius: 0 4px 4px 0;
    font-style: italic;
    box-shadow: -7px -7px 10px #eeeeee44, 7px 7px 10px #00000011;
    border-top: #ffffff66 1px solid;
    border-bottom: #00000017 1px solid;
    border-right: #00000017 1px solid;
}

/* Collapsible details styling */
details summary {
    cursor: pointer;
    color: #666;
}

.collapsible-details {
    margin-top: -2em;
}

.collapsible-details summary {
    position: relative;
    cursor: pointer;
}

/* Preview content styling - shown when closed */
.collapsible-details:not([open]) .preview-content {
    margin-top: 4px;
}

/* Hide preview content when details is open */
.collapsible-details[open] .preview-content {
    display: none;
}

/* Style the full details content */
.details-content {
    margin-top: 4px;
}

/* Hide details content when closed */
.collapsible-details:not([open]) .details-content {
    display: none;
}

/* Style pre and other elements within details content */
.content pre {
    background-color: transparent;
    padding: 0;
    margin: 0;
    font-size: 0.9em;
    color: #555;
    line-height: 1.3;
    white-space: pre-wrap;
    word-wrap: break-word;
}

/* Message filtering */
.message.filtered-hidden {
    display: none;
}

/* Session navigation styles */
.navigation {
    background-color: #f8f9fa66;
    border-radius: 8px;
    padding: 16px;
    margin-bottom: 24px;
    box-shadow: -7px -7px 10px #eeeeee44, 7px 7px 10px #00000011;
    border-left: #ffffff66 1px solid;
    border-top: #ffffff66 1px solid;
    border-bottom: #00000017 1px solid;
    border-right: #00000017 1px solid;
}

.navigation h2 {
    margin: 0 0 12px 0;
    font-size: 1.2em;
    color: #495057;
}

.session-nav {
    margin-top: 1em;
    display: grid;
    gap: 8px;
}

.session-link {
    padding: 8px 12px;
    background-color: #ffffff66;
    border: 1px solid #dee2e6;
    border-radius: 4px;
    text-decoration: none;
    color: #495057;
    transition: background-color 0.2s;
}

.session-link:hover {
    background-color: #ffffff99;
}

.session-link-title {
    font-weight: 600;
    font-size: 0.9em;
}

.session-link-meta {
    font-size: 0.8em;
    color: #6c757d;
    margin-top: 2px;
}

/* Project-specific session navigation */
.project-sessions {
    margin-top: 15px;
    border-top: 1px solid #dee2e6;
    padding-top: 15px;
}

.project-sessions h4 {
    margin: 0 0 10px 0;
    font-size: 0.9em;
    color: #495057;
    font-weight: 600;
}

.project-sessions .session-nav {
    max-height: 200px;
    overflow-y: auto;
}

.project-sessions .session-link {
    padding: 6px 8px;
    font-size: 0.8em;
    margin-bottom: 4px;
}

.project-sessions .session-link-title {
    font-size: 0.85em;
}

.project-sessions .session-link-meta {
    font-size: 0.75em;
}

/* Project card styles for index page */
.project-list {
    display: grid;
    gap: 15px;
}

.project-card {
    background-color: #ffffff66;
    border-radius: 8px;
    padding: 20px;
    box-shadow: -7px -7px 10px #eeeeee44, 7px 7px 10px #00000011;
    border-left: #ffffff66 1px solid;
    border-top: #ffffff66 1px solid;
    border-bottom: #00000017 1px solid;
    border-right: #00000017 1px solid;
}

.project-card:hover {
    box-shadow: -10px -10px 15px #eeeeee66, 10px 10px 15px #00000022;
    transform: translateY(-1px);
    transition: all 0.2s ease;
}

.project-name {
    font-size: 1.2em;
    font-weight: 600;
    margin-bottom: 10px;
    word-break: break-all;
}

.project-name a {
    text-decoration: none;
    color: #2196f3;
}

.project-name a:hover {
    text-decoration: underline;
}

.project-stats {
    color: #666;
    font-size: 0.9em;
    display: flex;
    gap: 20px;
    flex-wrap: wrap;
}

.stat {
    display: flex;
    align-items: center;
    gap: 5px;
}

/* Summary section */
.summary {
    text-align: center;
    margin-bottom: 30px;
    padding: 15px;
    background-color: #ffffff66;
    border-radius: 8px;
    box-shadow: -7px -7px 10px #eeeeee44, 7px 7px 10px #00000011;
    border-left: #ffffff66 1px solid;
    border-top: #ffffff66 1px solid;
    border-bottom: #00000017 1px solid;
    border-right: #00000017 1px solid;
}

.summary-stats {
    display: flex;
    flex-direction: column;
    align-items: center;
    gap: 15px;
}

.summary-stat {
    text-align: center;
}

.summary-stat .number {
    font-size: 1.5em;
    font-weight: 600;
    color: #2196f3;
}

.summary-stat .label {
    color: #666;
    font-size: 0.9em;
}

/* Filter toolbar and controls */
.filter-toolbar {
    background-color: #f8f9fa66;
    border-radius: 8px;
    padding: 12px 16px;
    margin-bottom: 16px;
    box-shadow: -7px -7px 10px #eeeeee44, 7px 7px 10px #00000011;
    border-left: #ffffff66 1px solid;
    border-top: #ffffff66 1px solid;
    border-bottom: #00000017 1px solid;
    border-right: #00000017 1px solid;
    display: none;
    position: sticky;
    top: 0;
    z-index: 100;
    backdrop-filter: blur(8px);
}

.filter-toolbar.visible {
    display: grid;
    grid-template-columns: auto 1fr auto;
    align-items: center;
    gap: 16px;
}

.filter-label {
    white-space: nowrap;
}

.filter-toggles {
    display: flex;
    flex-wrap: wrap;
    align-items: center;
    gap: 8px;
    justify-content: center;
}

.filter-toolbar h3 {
    margin: 0;
    font-size: 1em;
    color: #495057;
    font-weight: 600;
}

.filter-toggle {
    padding: 6px 12px;
    border: 1px solid #dee2e6;
    border-radius: 20px;
    background-color: transparent;
    color: #495057;
    font-size: 0.85em;
    font-weight: 500;
    cursor: pointer;
    transition: all 0.2s;
    display: flex;
    align-items: center;
    gap: 4px;
    white-space: nowrap;
}

.filter-toggle:hover {
    background-color: #ffffff99;
    transform: translateY(-1px);
}

.filter-toggle.active {
    background-color: #ffffffaa;
}

.filter-toggle.active:hover {
    background-color: #ffffff66;
}

.filter-actions {
    display: flex;
    gap: 6px;
    white-space: nowrap;
}

.filter-action-btn {
    padding: 4px 8px;
    border: 1px solid #dee2e6;
    border-radius: 4px;
    background-color: #ffffff66;
    color: #6c757d;
    font-size: 0.75em;
    cursor: pointer;
    transition: background-color 0.2s;
}

.filter-action-btn:hover {
    background-color: #ffffff99;
}

.filter-toggle .count {
    opacity: 0.7;
    font-size: 0.9em;
    margin-left: 2px;
}

.filter-toggle.active .count {
    opacity: 1;
}

/* Floating filter button */
.filter-messages {
    bottom: 140px;
}

.filter-messages.active {
    background-color: #fff3cd66;
}

/* Floating buttons positioning */
.scroll-top {
    bottom: 20px;
}

.toggle-details {
    bottom: 80px;
}

/* TodoWrite tool styling */
.todo-write {
    background-color: #f0f8ff66;
    border-left: #4169e188 3px solid;
    font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', 'Roboto', 'Helvetica Neue', Arial, sans-serif;
}

.tool-header {
    font-weight: 600;
    margin-bottom: 12px;
    color: #2c3e50;
    font-size: 1.1em;
}

.todo-list {
    background-color: #ffffff66;
    border-radius: 6px;
    padding: 8px;
    box-shadow: -7px -7px 10px #eeeeee44, 7px 7px 10px #00000011;
    border-left: #ffffff66 1px solid;
    border-top: #ffffff66 1px solid;
    border-bottom: #00000017 1px solid;
    border-right: #00000017 1px solid;
}

.todo-item {
    display: flex;
    align-items: center;
    gap: 8px;
    padding: 8px 4px;
    border-bottom: 1px solid #f0f3f6;
    transition: background-color 0.2s ease;
}

.todo-item:last-child {
    border-bottom: none;
}

.todo-item:hover {
    background-color: #f8f9fa;
}

.todo-item.completed {
    opacity: 0.7;
}

.todo-item.completed .todo-content {
    text-decoration: line-through;
    color: #6c757d;
}

.todo-item input[type="checkbox"] {
    margin: 0;
    cursor: default;
}

.todo-status {
    font-size: 1.1em;
    line-height: 1;
}

.todo-content {
    flex: 1;
    color: #333;
    font-weight: 500;
}

.todo-id {
    font-size: 0.8em;
    color: #6c757d;
    font-weight: normal;
}

/* Priority-based left border colors */
.todo-item.high {
    border-left: 3px solid #dc3545;
}

.todo-item.medium {
    border-left: 3px solid #ffc107;
}

.todo-item.low {
    border-left: 3px solid #28a745;
}

/* Status-based background tints */
.todo-item.in_progress {
    background-color: #fff3cd;
}

.todo-item.completed {
    background-color: #d4edda;
}

