    65→                message.css_class == 'system' %}⚙️ {% elif message.css_class == 'tool_use' %}🛠️ {% elif
    66→                message.css_class == 'tool_result' %}🧰 {% elif message.css_class == 'thinking' %}💭 {% elif
    67→                message.css_class == 'image' %}🖼️ {% endif %}{{ message.display_type }}</span>
