    83→
    84→    <script>
    85→        document.addEventListener('DOMContentLoaded', function () {
    86→            const toggleButton = document.getElementById('toggleDetails');
    87→            const filterButton = document.getElementById('filterMessages');
    88→            const filterToolbar = document.querySelector('.filter-toolbar');
    89→            const selectAllButton = document.getElementById('selectAll');
    90→            const selectNoneButton = document.getElementById('selectNone');
    91→            const closeFiltersButton = document.getElementById('closeFilters');
    92→            const filterToggles = document.querySelectorAll('.filter-toggle');
    93→
    94→            // Toggle details functionality
    95→            function updateToggleButton() {
    96→                const allDetails = document.querySelectorAll('details.collapsible-details');
    97→                const openCount = document.querySelectorAll('details[open].collapsible-details').length;
    98→                const totalCount = allDetails.length;
    99→
   100→                if (totalCount === 0) {
   101→                    toggleButton.style.display = 'none';
   102→                    return;
   103→                }
   104→
   105→                // If more than half are open, show "close all" state, otherwise show "open all"
   106→                const mostlyOpen = openCount > totalCount / 2;
   107→                toggleButton.textContent = mostlyOpen ? '📦' : '🗃️';
   108→                toggleButton.title = mostlyOpen ? 'Close all details' : 'Open all details';
   109→            }
   110→
   111→            function toggleAllDetails() {
   112→                const allDetails = document.querySelectorAll('details.collapsible-details');
   113→                const openCount = document.querySelectorAll('details[open].collapsible-details').length;
   114→                const shouldOpen = openCount <= allDetails.length / 2;
   115→
   116→                allDetails.forEach(details => {
   117→                    if (shouldOpen) {
   118→                        details.setAttribute('open', '');
   119→                    } else {
   120→                        details.removeAttribute('open');
   121→                    }
   122→                });
   123→
   124→                updateToggleButton();
   125→            }
   126→
   127→            toggleButton.addEventListener('click', toggleAllDetails);
   128→
   129→            // Filter toolbar toggle functionality
   130→            function toggleFilterToolbar() {
   131→                const isVisible = filterToolbar.classList.contains('visible');
   132→                if (isVisible) {
   133→                    filterToolbar.classList.remove('visible');
   134→                    filterButton.classList.remove('active');
   135→                    filterButton.title = 'Show filters';
   136→                } else {
   137→                    filterToolbar.classList.add('visible');
   138→                    filterButton.classList.add('active');
   139→                    filterButton.title = 'Hide filters';
   140→                }
   141→            }
   142→
   143→            filterButton.addEventListener('click', toggleFilterToolbar);
   144→            closeFiltersButton.addEventListener('click', toggleFilterToolbar);
   145→
   146→            // Count messages by type and update button labels
   147→            function updateMessageCounts() {
   148→                const messageTypes = ['user', 'assistant', 'system', 'tool_use', 'tool_result', 'thinking', 'image'];
   149→
   150→                messageTypes.forEach(type => {
   151→                    const messages = document.querySelectorAll(`.message.${type}:not(.session-header)`);
   152→                    const count = messages.length;
   153→                    const toggle = document.querySelector(`[data-type="${type}"]`);
   154→                    const countSpan = toggle.querySelector('.count');
   155→
   156→                    if (countSpan) {
   157→                        countSpan.textContent = `(${count})`;
   158→
   159→                        // Hide toggles for message types with 0 count
   160→                        if (count === 0) {
   161→                            toggle.style.display = 'none';
   162→                        } else {
   163→                            toggle.style.display = 'flex';
   164→                        }
   165→                    }
   166→                });
   167→            }
   168→
   169→            // Filter functionality
   170→            function applyFilter() {
   171→                const activeTypes = Array.from(filterToggles)
   172→                    .filter(toggle => toggle.classList.contains('active'))
   173→                    .map(toggle => toggle.dataset.type);
   174→
   175→                // Show/hide messages based on active toggle buttons
   176→                const allMessages = document.querySelectorAll('.message:not(.session-header)');
   177→                allMessages.forEach(message => {
   178→                    const shouldShow = activeTypes.some(type => message.classList.contains(type));
   179→                    if (shouldShow) {
   180→                        message.classList.remove('filtered-hidden');
   181→                    } else {
   182→                        message.classList.add('filtered-hidden');
   183→                    }
   184→                });
   185→
   186→                // Update visible counts in real-time
   187→                updateVisibleCounts();
   188→
   189→                // Update filter button appearance based on whether all types are selected
   190→                const allTypesSelected = activeTypes.length === filterToggles.length;
   191→                if (!allTypesSelected && filterToolbar.classList.contains('visible')) {
   192→                    filterButton.classList.add('active');
   193→                } else if (allTypesSelected && filterToolbar.classList.contains('visible')) {
   194→                    filterButton.classList.add('active');
   195→                }
   196→            }
   197→
   198→            function updateVisibleCounts() {
   199→                const messageTypes = ['user', 'assistant', 'system', 'tool_use', 'tool_result', 'thinking', 'image'];
   200→
   201→                messageTypes.forEach(type => {
   202→                    const visibleMessages = document.querySelectorAll(`.message.${type}:not(.session-header):not(.filtered-hidden)`);
   203→                    const totalMessages = document.querySelectorAll(`.message.${type}:not(.session-header)`);
   204→                    const visibleCount = visibleMessages.length;
   205→                    const totalCount = totalMessages.length;
   206→
   207→                    const toggle = document.querySelector(`[data-type="${type}"]`);
   208→                    const countSpan = toggle.querySelector('.count');
   209→
   210→                    if (countSpan && totalCount > 0) {
   211→                        // Show "visible/total" format when filtering is active
   212→                        const activeTypes = Array.from(filterToggles)
   213→                            .filter(toggle => toggle.classList.contains('active'))
   214→                            .map(toggle => toggle.dataset.type);
   215→
   216→                        const isFiltering = activeTypes.length < filterToggles.length;
   217→
   218→                        if (isFiltering && visibleCount !== totalCount) {
   219→                            countSpan.textContent = `(${visibleCount}/${totalCount})`;
   220→                        } else {
   221→                            countSpan.textContent = `(${totalCount})`;
   222→                        }
   223→                    }
   224→                });
   225→            }
   226→
   227→            function toggleFilter(button) {
   228→                button.classList.toggle('active');
   229→                applyFilter();
   230→            }
   231→
   232→            function selectAllTypes() {
   233→                filterToggles.forEach(toggle => {
   234→                    toggle.classList.add('active');
   235→                });
   236→                applyFilter();
   237→            }
   238→
   239→            function selectNoTypes() {
   240→                filterToggles.forEach(toggle => {
   241→                    toggle.classList.remove('active');
   242→                });
   243→                applyFilter();
   244→            }
   245→
   246→            // Event listeners for filter toggles
   247→            filterToggles.forEach(toggle => {
   248→                toggle.addEventListener('click', () => toggleFilter(toggle));
   249→            });
   250→
   251→            selectAllButton.addEventListener('click', selectAllTypes);
   252→            selectNoneButton.addEventListener('click', selectNoTypes);
   253→
   254→            // Initialize button state and message counts
   255→            updateToggleButton();
   256→            updateMessageCounts();
   257→        });
   258→    </script>
